function quickSort(arr, left, right, idx){
    var len = arr.length, 
    pivot,
    partitionIndex;

    if(left < right){
        pivot = right;
        partitionIndex = partition(arr, pivot, left, right, idx);
    
        quickSort(arr, left, partitionIndex - 1, idx);
        quickSort(arr, partitionIndex + 1, right, idx);
    }
    return arr;
}

function partition(arr, pivot, left, right, idx){
    var pivotValue = arr[pivot].getElementsByTagName("td")[idx].innerText,
    partitionIndex = left;

    for(var i = left; i < right; i++){
        if(arr[i].getElementsByTagName("td")[idx].innerText < pivotValue){
            swap(arr, i, partitionIndex);
            partitionIndex++;
        }
    }
    swap(arr, right, partitionIndex);
    return partitionIndex;
}

function swap(arr, i, j){
    var temp = arr[i];
    arr[i] = arr[j];
    arr[j] = temp;
}

        tbody.removeChild(tbody.firstChild);
    }

    // add sorted rows
    for (var i=0; i < arr.length; i++) {
        tbody.appendChild(arr[i]);
    }
}

    window.onload = function () {
      loadPage();
    }

    // 加载指定页面
    function loadPage() {
      var html = '';
      var tbody = document.getElementById('myTbody');
      for (var i = 0; i < data.length; i++) {
        var multiRent = data[i].multiRent;
        var highRent = data[i].highRent;
        var lowRent = data[i].lowRent;

        if (multiRent == null || multiRent == '') {
          multiRent = '--';
        }

        if (highRent == null || highRent == '') {
          highRent = '--';
        }

        if (lowRent == null || lowRent == '') {
          lowRent = '--';
        }

        html += '<tr><td>' + data[i].communityId + '</td><td>' + data[i].zoneName +
          '</td><td>' + data[i].communityName + '</td><td>' + multiRent +
          '</td><td>' + highRent + '</td><td>' + lowRent + '</td></tr>';
        
      }
      tbody.innerHTML = html;
    }



    // 搜索函数
    function searchFunction() {
      var inputCommunity, inputZone, inputName, filterCommunity, filterZone, filterName, table, tr, td, i;

      inputCommunity = document.getElementById("searchCommunity");
      inputZone = document.getElementById("searchZone");
      inputName = document.getElementById("searchName");

      filterCommunity = inputCommunity.value.toUpperCase();
      filterZone = inputZone.value.toUpperCase();
      filterName = inputName.value.toUpperCase();

      table = document.getElementById("myTable");
      tr = table.getElementsByTagName("tr");

      for (i = 1; i < tr.length; i++) {
        var tds = tr[i].getElementsByTagName("td");

        if (tds.length > 2 &&
          tds[0].innerHTML.toUpperCase().indexOf(filterCommunity) > -1 &&
          tds[1].innerHTML.toUpperCase().indexOf(filterZone) > -1 &&
          tds[2].innerHTML.toUpperCase().indexOf(filterName) > -1) {
          tr[i].style.display = "";
        } else {
          tr[i].style.display = "none";
        }
      }
    }
  </script>
